// src/components/Projects.js
import React from "react";

const projects = [
  {
    title: "Ecommerce Website",
    description: "A full-featured ecommerce platform with cart, checkout, and admin panel.",
    tech: ["React", "Node.js", "Express", "MongoDB"],
    github: "https://github.com/yourusername/ecommerce-website",
    demo: "https://ecommerce-demo.example.com",
  },
  {
    title: "AI Image Generator",
    description: "Generate images using AI models with an interactive interface.",
    tech: ["React", "Python", "TensorFlow", "Flask"],
    github: "https://github.com/yourusername/ai-image-generator",
    demo: "https://ai-image-demo.example.com",
  },
];

export default function Projects() {
  return (
    <section id="projects" className="my-12 px-4 max-w-5xl mx-auto">
      <h2 className="text-3xl font-bold mb-6 text-center">Projects</h2>
      <div className="grid grid-cols-1 md:grid-cols-2 gap-8">
        {projects.map(({ title, description, tech, github, demo }, idx) => (
          <div
            key={idx}
            className="border rounded-lg p-6 shadow-lg hover:shadow-2xl transition"
          >
            <h3 className="text-xl font-semibold mb-2">{title}</h3>
            <p className="mb-3">{description}</p>
            <p className="mb-3 font-mono text-sm">
              Tech: {tech.join(", ")}
            </p>
            <div className="flex space-x-4">
              <a
                href={github}
                target="_blank"
                rel="noopener noreferrer"
                className="text-blue-600 hover:underline"
              >
                GitHub
              </a>
              <a
                href={demo}
                target="_blank"
                rel="noopener noreferrer"
                className="text-green-600 hover:underline"
              >
                Demo
              </a>
            </div>
          </div>
        ))}
      </div>
    </section>
  );
}
